const Upload = () => {

    return ( 
        <main>
            <form action="submit">
                <section>
                    <label htmlFor="email">Email:</label>
                    <input type="email" placeholder="Type Email..."/>
                </section>
                <section>
                    <label htmlFor="email">Username</label>
                    <input type="email" placeholder="Type Username..."/>
                </section>
            </form>
        </main>
     );
}
 
export default Upload;
